import React from 'react';

const Movies = () => {
    return (
        <div
        style={{
            display: 'flex',
            justifyContent: 'Right',
            alignItems: 'Right',
            height: '100vh'
        }}
        >
            <h1>Movie List Ratings & Updates</h1>
        </div>
    );
};

export default Movies;
